/* [ STOCK - DOMESTIC ] */

CREATE TABLE trade_history_stock_domestic (
    t_date          DATE NOT NULL, 
    stock_name      VARCHAR(512),
    t_type	        VARCHAR(512),
    t_quant	        BIGINT NOT NULL DEFAULT 0, 
    t_unit_price    DECIMAL(12, 2) NOT NULL DEFAULT 0, 
    t_amount	    BIGINT NOT NULL DEFAULT 0, 
    commission	    INT NOT NULL DEFAULT 0, 
    tran_agri_tax   INT NOT NULL DEFAULT 0, 
    inc_resid_tax	INT NOT NULL DEFAULT 0, 
    settl_amount	BIGINT NOT NULL DEFAULT 0, 
    outstd_amount_ocur	BIGINT NOT NULL DEFAULT 0, 
    outstd_paym	  BIGINT NOT NULL DEFAULT 0, 
    delq_paym	  BIGINT NOT NULL DEFAULT 0, 
    deposit	      BIGINT NOT NULL DEFAULT 0, 
    sec_bal	      BIGINT NOT NULL DEFAULT 0, 
    loan_repay_amount  BIGINT NOT NULL DEFAULT 0,
    crd_loan_intrst	   INT NOT NULL DEFAULT 0,
    loan_date	DATETIME, 
    repay_fund	BIGINT NOT NULL DEFAULT 0,
    t_channel	VARCHAR(512),
    process_t   TIME NOT NULL 
);

-- TOTAL NET INCOME (Find income for total duration)
SELECT 
	( SELECT MIN(t_date) FROM trade_history_stock_domestic ) first_date, 
    ( SELECT MAX(t_date) FROM trade_history_stock_domestic ) last_date, 
    ( SELECT DATEDIFF(MAX(t_date), MIN(t_date)) FROM trade_history_stock_domestic ) duration_day,
	( FORMAT(
		(sell.t + dividend.t + 983000 * 1 + 16390 * 153) - (buy.t + sell.f + buy.f + dividend.f), 
        0)  /* 보유 중인 종목은 계산에서 제외 - 테이블 하나 더 새로 만들어야 할듯 */
	) income
FROM
	(
		SELECT SUM(t_quant * t_unit_price) t, SUM(commission + tran_agri_tax + inc_resid_tax) f 
        FROM trade_history_stock_domestic 
        WHERE t_type like '%매수%'
	) buy,
	(
		SELECT SUM(t_quant * t_unit_price) t, SUM(commission + tran_agri_tax + inc_resid_tax) f 
        FROM trade_history_stock_domestic 
        WHERE t_type like '%매도%'
   ) sell,
   (
		SELECT SUM(t_amount) t, SUM(commission + tran_agri_tax + inc_resid_tax) f 
        FROM trade_history_stock_domestic 
        WHERE t_type like '%배당금입금%'
   ) dividend;


